import React from "react";


class PressureSlider extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div id="pressureDiv">
                <span className="sliderSpan">
                    <input id="pressureSlider" className="slider floatRight" type="range" min="0" max="6000" step="0.01"
                        onChange={(event) => this._updateAtomicElementStatesFromSlider()} />
                </span>
            </div>
        );
    }
}


export default PressureSlider
